import React from 'react';
// import logo from './logo.svg';
import Header from './components/Header';
// import Ticket from './components/Ticket';
// import Login
import Login from './components/Login';

function App() {
  return (
    <div className="App">
      <Login />
      {/* <Form /> */}
      <Header agencyName={"Mogamo"}></Header>
      <Ticket location={"Bamenda"} destination={"Buea"} price={5000} dateOfDeparture={"July 20"} busNum={208} timeOfDay={"Night journey"} timeOfDeparture={"4:00 pm"}></Ticket>
    </div>
  );
}

export default App;
